    const [user_id , set_user_id] = useState(null)
    useEffect(()=>{
        let {id} = useParams()
        set_user_id(id)
        console.log(user_id)
    },[])

    return (<div className = "profile_div">
        <div className = "pic backgorud"></div>
   <h1>{user_id}</h1>
    </div>)
}

export default AppUserProfile;
